import './ExpensesList.css';
import ExpenseItem from "./ExpenseItem";

function ExpensesList(props) {
  return (
    <div className='.expenses-list'>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={props.expenses-list[0].title}
        amount={props.expenses-list[0].amount}
        date={props.expenses-list[0].date}
      />
      <ExpenseItem
        title={props.expenses-list[1].title}
        amount={props.expenses-list[1].amount}
        date={props.expenses-list[1].date}
      />
      <ExpenseItem
        title={props.expenses-list[2].title}
        amount={props.expenses-list[2].amount}
        date={props.expenses-list[2].date}
      />
      <ExpenseItem
        title={props.expenses-list[3].title}
        amount={props.expenses-list[3].amount}
        date={props.expenses-list[3].date}
      />
    </div>
  );
}

export default ExpensesList;
